    struct CollectionSettings {
        string name;
        string symbol;
        uint256 maxSupply;
        bytes contractMetadata;
    }

    /// @notice SPG ERC-721 collection types usable for new IP representation.
    /// TODO: Add other collection types (e.g. ERC721a / SeaDrop / etc.)
